        dic[newData[i].id] = {
          id: newData[i].id,
          testId: newData[i].testId,
          citzId: newData[i].citzId,
          tit: newData[i].tit,
          fname: newData[i].fname,
          lname: newData[i].lname,
          gndr: newData[i].gndr,
          age: newData[i].age,
          eduId: newData[i].eduId,
          brId: newData[i].brId,
          ans: newData[i].ans,
          d1x1: newData[i].d1x1,
