          d1x5: newData[i].d1x5,
          d1x6: newData[i].d1x6,
          d1x7: newData[i].d1x7,
          d1x8: newData[i].d1x8,
          d1x9: newData[i].d1x9,
          d2x1: newData[i].d2x1,
          d2x2: newData[i].d2x2,
          d2x3: newData[i].d2x3,
          d2x4: newData[i].d2x4,
          d2x5: newData[i].d2x5,
          d2x6: newData[i].d2x6,
          d2x7: newData[i].d2x7,
          d2x8: newData[i].d2x8,
          d2x9: newData[i].d2x9,
          d1r1: newData[i].d1r1,
          d1r2: newData[i].d1r2,
          d1r3: newData[i].d1r3,
          d1r4: newData[i].d1r4,
          d1r5: newData[i].d1r5,
          d1r6: newData[i].d1r6,
          d1r7: newData[i].d1r7,
