          d2r12: newData[i].d2r12,
          d2r13: newData[i].d2r13,
          d2r14: newData[i].d2r14,
          d2r15: newData[i].d2r15,
          d2r16: newData[i].d2r16,
          d2r17: newData[i].d2r17,
          d2r18: newData[i].d2r18,
          avg1: newData[i].avg1,
          avg2: newData[i].avg2,
          avg3: newData[i].avg3,
          avg4: newData[i].avg4,
          avg5: newData[i].avg5,
          avg6: newData[i].avg6,
          avg7: newData[i].avg7,
          avg8: newData[i].avg8,
          avg9: newData[i].avg9,
          avg10: newData[i].avg10,
          avg11: newData[i].avg11,
          avg12: newData[i].avg12,
          avg13: newData[i].avg13,
          avg14: newData[i].avg14,
          avg15: newData[i].avg15,
          avg16: newData[i].avg16,
          avg17: newData[i].avg17,
          avg18: newData[i].avg18,
